import React, { Component } from "react";
import Header from "../Header/Header";

export default class Home extends Component {
    constructor(){
        super();
        this.state={
            title:"首页"
        }
    }
  render() {
    return (
      <div className="home-page">
        <Header back={<span onClick={()=>{this.props.history.go(-1)}}> &l返回 </span>} title={this.state.title} handClick={<span>操作</span>}></Header>
      </div>
    );
  }
}
